import React from 'react';

export const Knowledge = ({screenWidth}) => {

    const listsArray = [
        ['HTML5', 'CSS3', 'JavaScript'],
        ['SQL', 'React', 'Firebase'],
        ['Responsive Design', 'On-page SEO', 'Test Driven Development']
    ]

    return (
        <section id="knowledge">
            <div class="content">
                <h2>My Knowledge</h2>
                <p>Some of the useful knowledge and skills I possess.</p>
                <div class="container">

                    {listsArray.map((itemsArray, i) => {
                        return (
                            <div class="KST" id={`"knowledge_box_"${i + 1}`}>
                                <ul>
                                    {itemsArray.map(item => {
                                        return <li>{item}</li>
                                    })}
                                </ul>
                            </div>
                        )
                    })}
                </div>
            </div>
        </section>
    )
}
